	add("paska", "{\"term\":\"paska\", \"etymology\":{\"influencers\":[], \"languages\":[\"official aramaic (700-300 bce)\", \"English\", \"ancient greek (to 1453)\", \"Hebrew\", \"Russian\", \"Ukrainian\"], \"text\":\"From Ukrainian {{m|uk|па́ска}} and Russian {{l|ru|па́ска}}, borrowing from Ancient greek (to 1453) {{m|grc|πάσκα}}, phonetic variant of {{m|grc|πάσχα}}, from Official aramaic (700-300 bce) {{m|arc|פסחא|tr\u003dpasḥa}}, from Hebrew {{m|he|פֶּסַח|tr\u003dpesaḥ}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A traditional Ukrainian egg bread, often decorated, used in Easter traditions\", \"priority\":1}]}, \"synonyms\":{}}");

