	add("pasquinade", "{\"term\":\"pasquinade\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\"], \"text\":\"From French \u0027pasquinade\u0027 from \u0027\u0027 + \u0027\u0027 modelled on Italian \u0027pasquinata\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lampoon, originally as published in public; a satire or libel on someone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1926\u0027\u0027, \u0027The Great Gatsby\u0027, Penguin 2000, p. 155\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I thought the whole tale would shortly be served up in racy \u0027\u0027pasquinade\u0027\u0027 – but Catherine, who might have said anything, didn\u0027t say a word\", \"priority\":3}]}, \"synonyms\":{}}");

