	add("passageway", "{\"term\":\"passageway\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|passage|way|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A covered walkway, between rooms or buildings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, \u0027\u0027 Chapter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The door of the twins\u0027 room opposite was open; a twenty-watt night-light threw a weak yellow glow into the \u0027\u0027passageway\u0027\u0027. David could hear the twins breathing in time with each other\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any way for passing in, out or through something\", \"priority\":4}]}, \"synonyms\":{}}");

	add("passback", "{\"term\":\"passback\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|pass|back|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"circumvention of an access restriction to a physical site by passing one\u0027s access card to another person after having entere\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, \u0027Security Management\u0027 (volume 32, issues 1-6, page 107\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Because each card reader is programmed for either entrance or exit, users must pass in and out before being allowed to reenter, thus eliminating \u0027\u0027passback\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, IFPO, \u0027The Protection Officer Training Manual\u0027 (page 99\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Modern electronic access systems have many features to enhance the level of access control to a facility, area, or room. Turnstiles, interlocking mantraps, and parkade gates are combined with access readers to prevent \u0027\u0027passback\", \"priority\":5}]}, \"synonyms\":{}}");

