	add("passenger", "{\"term\":\"passenger\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027passagier\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who rides or travels in a vehicle, but who does not operate it and is not a member of the crew\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It is never possible to settle down to the ordinary routine of life at sea until the screw begins to revolve. There is an hour or two, after the \u0027\u0027passengers\u0027\u0027 have embarked, which is disquieting and fussy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/technology-quarterly/21578516-transport-new-train-technologies-are-less-visible-and-spread-less-quickly Ideas coming down the passage\u003dA “moving platform” schemeis more technologically ambitious than maglev trains even though it relies on conventional rails. Local trains would use side-by-side rails to roll alongside intercity trains and allow \u0027\u0027passengers\u0027\u0027 to switch trains by stepping through docking bays\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A young hunting bird that can fly and is taken while it is still in its first year\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A passer-by; a wayfarer\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1599\u0027\u0027, \u0027s: The Two Gentlemen of Verona (Shakespeare; First The Two Gentlemen of Verona\u0027, V. iv. 15\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"These are my mates, that make their wills their law, / Have some unhappy \u0027\u0027passenger\u0027\u0027 in chase\", \"priority\":7}]}, \"synonyms\":{}}");

