	add("passkey", "{\"term\":\"passkey\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|pass|key|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A key, especially in a hotel, that allows someone in authority to open any doo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, \u0027Monsieur\u0027, Faber \u0026amp; Faber 1992, p. 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Jourdain stood by with a quiet sad smile, holding his \u0027\u0027passkey\u0027\u0027 in his hand, and giving me time to take it all in\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A password\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Harold F Tipton, Micki Krause, \u0027Information Security Management Handbook\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The router then generates a random numeric \u0027\u0027passkey\u0027\u0027 and delivers it to the user\", \"priority\":6}]}, \"synonyms\":{}}");

