	add("passport", "{\"term\":\"passport\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027passeport\u0027 from \u0027passer\u0027 (pass) + \u0027port\u0027 (port) Compare {{l|en|portpass}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An official document normally used for international journeys, which proves the identity and nationality of the person for whom it was issued\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"You will have to bring your \u0027\u0027passport\u0027\u0027 to prove who you are\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any document that allows entry or passage\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something which enables someone to do or achieve something\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The tenor\u0027s voice was his \u0027\u0027passport\u0027\u0027 to the international concert circuit\", \"priority\":5}]}, \"synonyms\":{}}");

