	add("pastafarianism", "{\"term\":\"pastafarianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|pasta|Rastafarianism|lang\u003den}}; popularized in 2005 by Bobby Henderson as a satirical protest against the teaching of intelligent design.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A parody religion centered around the Flying Spaghetti Monster, a creator deity who resembles spaghetti and meatballs\", \"priority\":1}]}, \"synonyms\":{}}");

