	add("pastern", "{\"term\":\"pastern\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027pasturon\u0027 (French \u0027pâturon\u0027), from \u0027pasture\u0027 ‘shackle’ (from Latin \u0027pastoria\u0027 ‘shackle for pastured animal\u0027s foot’) + diminutive suffix.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The area on a horse\u0027s leg between the fetlock joint and the hoof\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, Leo Tolstoy, \u0027Anna Karenina\u0027, translated by Louise and Aylmer Maude (Oxford 1998), page 158\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was quite impossible to ride over the deeply-ploughed field; the earth bore only where there was still a little ice, in the thawed furrows the horse\u0027s legs sank in above its \u0027\u0027pasterns\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1928\u0027\u0027, \u0027Memoirs of a Fox-Hunting Man\u0027, Penguin 2013, p. 227\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Below me, somewhere in the horse-lines, stood Cockbird, picketed to a peg in the ground by a rope which was already giving him a sore \u0027\u0027pastern\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A shackle for horses while pasturing\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A patten\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pasteurisation", "{\"term\":\"pasteurisation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027pasteurisation\u0027 from the surname of its inventor, w:Louis Pasteur|Louis Pasteur.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Heat-treatment of a perishable food to destroy heat-sensitive vegetative cells followed by immediate cooling to limit growth of the surviving cells and germination of spores\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pastiche", "{\"term\":\"pastiche\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Italian\", \"Latin\"], \"text\":\"Via French \u0027pastiche\u0027 from Italian \u0027pasticcio\u0027 (pie, something blended) from {{m|la|*pasticium}}, from Latin \u0027pasta\u0027 (dough, pastry cake, paste) from Ancient greek (to 1453) \u0027παστά\u0027 (barley porridge) from \u0027παστός\u0027 (sprinkled with salt)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|w:Botticelli|Botticelli\u0027s original on the left, \u0027\u0027pastiche\u0027\u0027 on the right. (1\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A work of art, drama, literature, music, or architecture that imitates the work of a previous artist\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A musical medley, typically quoting other works\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An incongruous mixture; a hodgepodge\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A postmodern playwriting technique that fuses a variety of styles, genres, and story lines to create a new form\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pastille", "{\"term\":\"pastille\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A soft flavoured candy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A medicinal pill, originally compressed herbs. A \u0027throat pastille\u0027 is a large candy-like lozenge, which, when sucked, releases oils to soothe a sore throat and sometimes vapors to help unblock the nose or sinuses\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A small granular half spheroid piece of material\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pastime", "{\"term\":\"pastime\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle english (1100-1500) \u0027passe tyme\u0027 calqued on Middle french (ca. 1400-1600) \u0027passe-temps\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which amuses, and serves to make time pass agreeably; sport; amusement; diversion; games\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003dS:The Wealth of Nations/Book I/Chapter The Wealth of year\u003d1776\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lax court morals and the absurd chivalry business were in full feather, and the joust and the tournament were the frequent \u0027\u0027pastime\u0027\u0027 of titled fine gentlemen who could fight better than they could author\u003d|title\u003dS:Life on the Mississippi/Chapter Life on the year\u003d1883\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An indulgent playmate, Grannie would lay aside the long scratchy-looking letter she was writing (heavily crossed ‘to save notepaper’) and enter into the delightful \u0027\u0027pastime\u0027\u0027 of ‘a chicken from Mr Whiteley\u0027s’\", \"priority\":4}]}, \"synonyms\":{}}");

	add("pasting", "{\"term\":\"pasting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Defeat, beating\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Usonians are giving a nasty pasting to your limey ass\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pastirma", "{\"term\":\"pastirma\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Turkish\"], \"text\":\"From Turkish \u0027pastırma\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A highly seasoned, air-dried cured beef in Ottoman cuisine\", \"priority\":1}]}, \"synonyms\":{}}");

