	add("pastophorus", "{\"term\":\"pastophorus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027pastophorus\u0027 from Hellenistic Ancient greek (to 1453) \u0027παστοφόρος\u0027 from \u0027παστός\u0027 (?shrine) + \u0027-ϕόρος\u0027 (-phore)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of priest in ancient Egypt, responsible for carrying holy shrines in official ceremonies or processions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pastor", "{\"term\":\"pastor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027pastor\u0027 (Modern French \u0027pasteur\u0027 , from Latin \u0027pastor\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A shepherd; someone who tends to a flock of animals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone with spiritual authority over a group of peopl\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"http://www.thefreedictionary.com/pasto\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A Muslim ima\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Meridel Rawlings, \u0027Fishers and hunters\u0027, page 27\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Beth Moore, \u0027Voices of the Faithful\u0027, page 12\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A minister or a priest in a Christian church\", \"priority\":7}]}, \"synonyms\":{}}");

