	add("pastrami", "{\"term\":\"pastrami\", \"etymology\":{\"influencers\":[], \"languages\":[\"Greek\", \"English\", \"ancient greek (to 1453)\", \"Romanian\", \"Turkish\", \"Yiddish\"], \"text\":\"From Yiddish \u0027פּאַסטראַמע\u0027 from Romanian {{m|ro|pastrama}}. That word is probably from Turkish {{m|tr|pastırma}}, a variation of {{m|tr|bastırma||dried meat}}, from root \u0027*bas-\u0027, to press; the other possible origin of the Romanian word is the Greek {{m|el|παστώνω||I salt}}, from Ancient greek (to 1453) {{m|grc|παστός||sprinkled with salt, salted}}. The English spelling ending in \u0027-mi\u0027 is probably from the influence of {{m|en|salami}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A seasoned smoked cut of beef\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pastry", "{\"term\":\"pastry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"{{suffix|paste|ry|lang\u003den}}, or Old french (842-ca. 1400) \u0027pastaierie\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A baked food group which contains items made from flour and fat pastes such as pie crust; also tarts, bear claws, napoleons, puff pastries, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The type of light flour-based dough used in pastries\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The place where pastry is made\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1591\u0027\u0027, w: William William Shakespeare, \u0027s: The Tragedy of Romeo and Romeo and Juliet\u0027, IV. iv. 2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"They call for dates and quinces in the \u0027\u0027pastry\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pasture", "{\"term\":\"pasture\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027pastour\u0027, Anglo-norman and Middle french (ca. 1400-1600) pastur. Old French|\u0027pasture\u0027, from Latin \u0027pastura\u0027 from the stem of \u0027pascere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Land on which cattle can be kept for feeding\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Ground covered with grass or herbage, used or suitable for the grazing of livestock\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Bible, Psalms xxiii\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He maketh me to lie down in green \u0027\u0027pastures\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"So graze as you find \u0027\u0027pasture\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Food, nourishment\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, Edmund Spenser, \u0027The Faerie Queene\u0027, III.x\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Ne euer is he wont on ought to feed, / But toades and frogs, his \u0027\u0027pasture\u0027\u0027 poysonous\", \"priority\":9}]}, \"synonyms\":{}}");

